import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom"

import Home from "./pages/Header";
const App = () => {
  return (
  <Router>
    <Switch>
      <Route>
        <Home />
      </Route>
    </Switch>
  </Router>
  )
}

export default App;
